import Book from "./Book";
function BookList({Boook,deleteBook,updateBook}){
    return(
        <>
        
        {Boook.map((book) => (
            <Book
              key={book.id}
              Name={book.Name}
              Author={book.Author}
              Publisher={book.Publisher}
              Avability={book.Avability}
              Ledger={book.Ledger}
              id = {book.id}
              deleteBook = {deleteBook}
              updateBook = {updateBook}
              
            />
          ))}
